import React from 'react';
import '../css/About.css';
import nateshim from '../static/nateshim.jpg'
import Typography from '@material-ui/core/Typography';
import Box from '@material-ui/core/Box';
import Container from '@material-ui/core/Container';
import Avatar from '@material-ui/core/Avatar';
import { makeStyles } from '@material-ui/core/styles';
import Grid from '@material-ui/core/Grid';


const useStyles = makeStyles({
  avatar: {
    margin: 100,
    width: 380,
    height: 380,
  },
});
function About() {
  const classes = useStyles();
  return (
    <div className="About">
      <header className="About-header">
        <Box display="flex" flexDirection="row">
          <Avatar src={nateshim}  className = {classes.avatar} alt = "nateshim"></Avatar>
        </Box>
        <Box>
          <Grid>
            ABOUT
          </Grid>
          <Box>
            Hello, welcome to my website. Here, I have uploaded my contact information, projects that I have worked on both music and software related, as well as 
            basic contact information and my resume. 
          </Box>
        </Box>
      </header>
      <ul className="Contact">
        <Box>
          <Typography>Contact</Typography>
          <Typography>Email: nateshim@gmail.com</Typography>
          <Typography>Phone number: (510)-710-2091 </Typography>
          <Typography>Linkedin: https://www.linkedin.com/in/nathanael-shim-324b55115/</Typography>
        </Box>
      </ul>
    </div>
  );
}

export default About;
